using System;
using System.Collections.Generic;

class Program
{
    static void Main()
    {
        // –î–∞–Ω–Ω—ã–µ –∑–∞–¥–∞—á–∏ (–≥–æ—Ä–æ–¥–∞ –∏ —Ä–∞—Å—Å—Ç–æ—è–Ω–∏—è –º–µ–∂–¥—É –Ω–∏–º–∏)
        int[,] distances = new int[5, 5]
        {
            {0, 4, 8, 12, 16},
            {4, 0, 7, 11, 15},
            {8, 7, 0, 9, 13},
            {12, 11, 9, 0, 5},
            {16, 15, 13, 5, 0}
        };

        // –ê–ª–≥–æ—Ä–∏—Ç–º –ø–æ–∏—Å–∫–∞ –∫—Ä–∞—Ç—á–∞–π—à–µ–≥–æ –ø—É—Ç–∏ (–Ω–∞–ø—Ä–∏–º–µ—Ä, –∞–ª–≥–æ—Ä–∏—Ç–º –î–µ–π–∫—Å—Ç—Ä—ã)
        List<int> shortestPath = Dijkstra(distances);

        // –í—ã–≤–æ–¥ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–∞
