            Console.Write($"{city} ");
        }
        Console.WriteLine();
    }

    // –†–µ–∞–ª–∏–∑–∞—Ü–∏—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –î–µ–π–∫—Å—Ç—Ä—ã –¥–ª—è –ø–æ–∏—Å–∫–∞ –∫—Ä–∞—Ç—á–∞–π—à–µ–≥–æ –ø—É—Ç–∏
    static List<int> Dijkstra(int[,] distances)
    {
        // –ò–Ω–∏—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è –º–∞—Å—Å–∏–≤–∞ —Ä–∞—Å—Å—Ç–æ—è–Ω–∏–π
        int n = distances.GetLength(0);
        bool[] visited = new bool[n];
        int[] dist = new int[n];
        int[] prev = new int[n];

        for (int i = 0; i < n; i++)
        {
            dist[i] = distances[0, i];
            prev[i] = 0;
        }

        dist[0] = 0;

        while (!visited[n - 1])
        {
            int u = FindMinDistance(dist, visited);

            visited[u] = true;

            for (int v = 0; v < n; v++)
            {
                if (!visited[v] && dist[u] + distances[u, v] < dist[v])
                {
                    dist[v] = dist[u] + distances[u, v];
                    prev[v] = u;
                }
            }
        }

        return BuildShortestPath(prev, n);
    }

    // –ü–æ–∏—Å–∫ –≥–æ—Ä–æ–¥–∞ —Å –º–∏–Ω–∏–º–∞–ª—å–Ω—ã–º —Ä–∞—Å—Å—Ç–æ—è–Ω–∏–µ–º
    static int FindMinDistance(int[] dist, bool[] visited)
    {
        int minDist = int.MaxValue;
        int minIndex = -1;

        for (int i = 0; i < dist.Length; i++)
        {
            if (!visited[i] && dist[i] < minDist)
            {
                minDist = dist[i];
                minIndex = i;
            }
        }

        return minIndex;
    }

    // –í–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ –∫—Ä–∞—Ç—á–∞–π—à–µ–≥–æ –ø—É—Ç–∏
    static List<int> BuildShortestPath(int[] prev, int n)
    {
        List<int> path = new List<int>();
        int current = n - 1;

        while (current != 0)
        {
            path.Add(current);
            current = prev[current];
        }

        path.Reverse();
        return path;
    }
}
